import React from 'react';

import SignIn from '../../components/sign-in/sign-in.component';

import './sign-in-and-sign-up.styles.scss';

const SigninSignup = () => (
  <div className='signin-signup'>
    <SignIn />
  </div>
);

export default SigninSignup;
